import React from 'react';
import './DisplayImage.css';

const DisplayImage = ({imageUrl, box}) =>{
    return(
        <div className='centerd ma'>
            <div className='absolute mt2'>
            <img src={imageUrl} alt='photosss' width='500px' height='auto' id="inputImage" />
            </div>
            <div className='bounding-box' style={{top: boxSize.topRow, right:boxSize.rightCol, bottom: boxSize.bottomRow, left:boxSize.leftCol}}></div>
        </div>

    );
}

export default DisplayImage;
